description:
The whole first season of 'Better Off Ted' encoded for PSP and hardsubbed in English. Specially for those who want to catch up with this excellent series and either watches tv in noisy environment or having a hard time understanding what americans say.

480x272, 640+100 kbps.
Tested on PSP, but probably should work with iPhone/Zune.
Encoded with MeGUI/x264/neroAac	
